import React from "react";
import Greeting from "./dashboard/Greeting";
import Calendar from "./dashboard/Calendar";
import Bodycards from "./dashboard/Bodycards";

export default function dashboard() {
  return (
    <div className="">
      <div className=" gap-2">
        <div className="grid grid-cols-12  gap-2">
          <div className="h-auto col-span-12 xl:col-span-9 bg-white p-4 rounded-md sticky">
            <Greeting />
          </div>
          <div className="col-span-12 xl:col-span-3 h-[70vh] bg-white p-4 rounded-md sticky">
            <Calendar />
          </div>
          <div className="col-span-12 xl:col-span-9 xl:h-[50vh] overflow-scroll scrollbar-hide">
            <Bodycards />
          </div>
        </div>
      </div>
    </div>
  );
}
